''' #################################核心的一句话############################################################################   
    我们考虑以 i 结尾的和为 k 的连续子数组个数时，只要统计有多少个前缀和为 pre[i]−k 的 pre[j] 即可
    
    因为，每当出现了一个前缀和为 pre[i]−k 的 pre[j]的情况，此时从j到i的位置，也就是pre[i]和pre[j]的差就是k

    遍历到i时，直接去查到mp[pre[i]−k]是否存在即可！！！存在几个，那么前缀和就有几个！！
    这种情况下，也一定要初始化一个0出来，给第一次检查提供参考！
    #########################################################################################################################   '''
pre=0
count=0
pre_count={0:1}
for i in range(len(nums)):
    pre+=nums[i]
    if(pre-k in pre_count):
        count+=pre_count[pre-k]

    #下面这两句其实等价于这一句  mp[pre] = mp.get(pre, 0) + 1，如果不存在则创建，存在则取出来。这个其实是字典，后面的值的default
    if (pre) not in pre_count:
        pre_count[pre]=0
    pre_count[pre] +=1
    
print(count)
