        #这些结果在后续中可能会用到，也可能不会用到！！！！
    
    #如果当前的前缀和不在这个结果字典里，那就创建一个
    if pre_sum[i] not in pre_count:
        pre_count[pre_sum[i]]=0
    #当前前缀和大小，出现的次数+1，key是大小，value是值
    pre_count[pre_sum[i]] +=1
